import * as React from "react";
import { Link as MuiLink } from "@mui/material";
import styled from "./styled";
const StyledLink = styled(MuiLink)({
    display: "flex",
    width: "100%",
    maxWidth: "fit-content",
    fontSize: "14px",
    color: "#3548D4",
    overflow: "hidden",
    textOverflow: "ellipsis",
}, props => ({
    textTransform: props.$textTransform,
}));
export const Link = ({ href, textTransform = "none", target = "_blank", children, ...props }) => (React.createElement(StyledLink, Object.assign({ href: href, target: target, rel: "noopener noreferrer", "$textTransform": textTransform }, props), children));
